    false,nt"url": null,nt"notes": "The Light Detection and Ranging (LiDAR)
    LAS dataset is a survey of select areas within Rutland Ranch. This data falls in
    Manatee County. These data were produced for the Southwest Florida Water Management
    District (SWFWMD). The Rutland Ranch LiDAR Survey project area consists of approximately
    17 square miles. The LiDAR point cloud was flown at a density sufficient to support
    a maximum final post spacing of 4 feet for unobscured areas. 3001 Inc. acquired
    40 flightlines on February 1, 2006. The data was divided into 5000' by 5000' foot
    cells that serve as the tiling scheme. The Rutland Ranch LiDAR Survey was collected
    under the guidance of a Professional Mapper/ Surveyor.",nt"license_title":
